  return (
    <div>
      <header>
        <div className="Little_Greeting">Welcome to Tripster!</div>
        <div className="Greeting_title">Sign up</div>
      </header>

      <div>
        <RegisterForm />
        <Button text="Start exploring" type="signup" click={handleClick} />
      </div>
    </div>
  );
}
